import axios from 'axios'
import React, { Component } from 'react'


export class Car extends Component {
  state={
      cars:[]
  }

    componentDidMount() {
        axios.get(`http://localhost:8080/api/cars`)
          .then(res => {
          const cars= res.data;
          this.setState({cars})
          })
      }

    render() {
        return (
            <div className="row" style={{padding:10}}>     

{ this.state.cars.map(car => <div className="col-sm-6">
            <div className="card">
                <div className="card-body">

                    <h5 className="card-title"><span class="badge badge-info">Plaka :  </span>{car.plaka}</h5>
                    <h5 className="card-title"><span class="badge badge-info">Marka: </span>{car.marka}</h5>
                    <h5 className="card-title"><span class="badge badge-info">Model: </span>{car.model}</h5>

                    <button type="button" class="btn btn-danger">Danger</button>
                </div>
            </div>
            </div>   )}



            </div>






        )}
}

export default Car
